import React, {Component} from "react";
import "../../styles/components/_error.scss";
import mug from "./public/cute_mug_sad.svg";

class ErrorPopup extends Component {
    render () {
        return (
            <div className="error">
                <div className="error__container">
                    <button onClick={()=>console.log("oooooooo")} className="error__container__close">X</button>

                    <div className="error__container__logo">
                        <img src={mug} className="error__container__logo--img" alt="error mug" />
                    </div>
                    <div className="error__container__header">
                        <h1 className="error__container__header--title">
                            Uh, oh
                        </h1>
                    </div>
                    <div className="error__container__description">
                        <span className="error__container__description--text">
                            We're sorry, but something went wrong.
                        </span>
                    </div>
                </div>
            </div>
        );
    }
}

export default ErrorPopup;
